import { Link } from 'react-router-dom';

function AllCities(props) {

    return (
        <div>
            {/* <Link to="/show">Landing Page</Link> */}
            {props.posts.map((post, id) => {
                return (
                <div key={id}>
                <h3>{post.title}</h3>
                <h5>{post.author}</h5>
                <p>{post.content}</p>
                </div>
